import React from "react";

const Footer = () => {
  return (
    <div className="bg-gray-700 p-4">
      <div className="container mx-auto text-center font-bold text-white">
        Projeto Desenvolvido por: 
        <a className='px-2 hover:underline' href=''> Elian Marcos</a> /
        <a className='px-2 hover:underline' href="https://linkedin.com/in/elian-marcos/"> Linkedin</a> /
        <a className='px-2 hover:underline' href="https://github.com/Elian07"> GitHub</a> /
        <img className='inline' src='/logo_devpleno.png' alt='DevPleno'/>
        <img className='inline' src='/logo_semana_fsm.png' alt='Semana Fullstack Master'/>
      </div>
    </div>
  );
};

export default Footer;
